(22, 'BUTTERFLY TECHNIQUE', 'Stress', 'm43voP4KyRM', 'NULL', '2023-10-04', 14, '/home/rafikiapp/public_html/web-app/publication-uploads/butterfly breathing.jpeg', 'video'),
